class Solution(object):
    def increasingTriplet(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        p1 = 0
        p2 = 0
        if len(nums) <= 2:
            return False
        if nums[0] < nums[1]:
            p1, p2 = nums[0], nums[1]
        else:
            p1 = nums[1]
            p2 = float("inf")
        for i in range(2,len(nums)):
            if p1 < nums[i] and p2 < nums[i]:
                return True
            elif p1 < nums[i] and nums[i] < p2:
                p2 = nums[i]
            elif nums[i] < p1:
                p1 = nums[i]
        return False

